import React from 'react'

function ProfileEdit({ userdata }) {

    return (
        <div>
            <h4>Your Profile</h4>
            <input
                placeholder='Edit full name'
                type='text'
                name='editname'
                value={userdata.fname}
                onChange={(e) => {
                    setUserid(e.target.value);
                }}
            />
            <input
                placeholder='Edit email'
                type='text'
                name='editemail'
                value={userdata.em}
                onChange={(e) => {
                    setUserid(e.target.value);
                }}
            />
            <input
                placeholder='Edit password'
                type='text'
                name='editpass'
                onChange={(e) => {
                    setUserid(e.target.value);
                }}
            />
            <button>Save</button>
        </div>
    )
}

export default ProfileEdit
